import React from 'react'
import sumicon from '../images/statistics.png'


const StatisticsBtn = () => {
  return (
    <div>
      <button className='summaryBtn'>Task Summary <img src={sumicon} alt='task summary icon' /></button>
    </div>
  )
}

export default StatisticsBtn
